{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/phildrysdale/tdn-2020-survey-data-exploration?scriptVersionId=104887395\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"code","execution_count":1,"id":"3dbcc177","metadata":{"_execution_state":"idle","_uuid":"051d70d956493feee0c6d64651c6a088724dca2a","execution":{"iopub.execute_input":"2022-09-04T12:40:43.907735Z","iopub.status.busy":"2022-09-04T12:40:43.904949Z","iopub.status.idle":"2022-09-04T12:40:45.246024Z","shell.execute_reply":"2022-09-04T12:40:45.244225Z"},"papermill":{"duration":1.382462,"end_time":"2022-09-04T12:40:45.249166","exception":false,"start_time":"2022-09-04T12:40:43.866704","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching packages\u001b[22m ─────────────────────────────────────── tidyverse 1.3.1 ──\n","\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2\u001b[39m 3.3.6     \u001b[32m✔\u001b[39m \u001b[34mpurrr  \u001b[39m 0.3.4\n","\u001b[32m✔\u001b[39m \u001b[34mtibble \u001b[39m 3.1.7     \u001b[32m✔\u001b[39m \u001b[34mdplyr  \u001b[39m 1.0.9\n","\u001b[32m✔\u001b[39m \u001b[34mtidyr  \u001b[39m 1.2.0     \u001b[32m✔\u001b[39m \u001b[34mstringr\u001b[39m 1.4.0\n","\u001b[32m✔\u001b[39m \u001b[34mreadr  \u001b[39m 2.1.2     \u001b[32m✔\u001b[39m \u001b[34mforcats\u001b[39m 0.5.1\n","\n","── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()\u001b[39m masks \u001b[34mstats\u001b[39m::filter()\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mlag()\u001b[39m    masks \u001b[34mstats\u001b[39m::lag()\n","\n"]},{"data":{"text/html":["'the-deconstruction-network-initial-survey-2020'"],"text/latex":["'the-deconstruction-network-initial-survey-2020'"],"text/markdown":["'the-deconstruction-network-initial-survey-2020'"],"text/plain":["[1] \"the-deconstruction-network-initial-survey-2020\""]},"metadata":{},"output_type":"display_data"}],"source":["# This R environment comes with many helpful analytics packages installed\n","# It is defined by the kaggle/rstats Docker image: https://github.com/kaggle/docker-rstats\n","# For example, here's a helpful package to load\n","\n","library(tidyverse) # metapackage of all tidyverse packages\n","\n","# Input data files are available in the read-only \"../input/\" directory\n","# For example, running this (by clicking run or pressing Shift+Enter) will list all files under the input directory\n","\n","list.files(path = \"../input\")\n","\n","# You can write up to 20GB to the current directory (/kaggle/working/) that gets preserved as output when you create a version using \"Save & Run All\" \n","# You can also write temporary files to /kaggle/temp/, but they won't be saved outside of the current session"]},{"cell_type":"markdown","id":"793b0b44","metadata":{"papermill":{"duration":0.032422,"end_time":"2022-09-04T12:40:45.314435","exception":false,"start_time":"2022-09-04T12:40:45.282013","status":"completed"},"tags":[]},"source":["# The Deconstruction Network - 2020 Initial Survey Results\n","### Phil Drysdale\n","### 19/08/22\n","---\n","# For the non-techies\n","This report on here is to show the full process of our working with the data - you can find more accessible resources here:\n","\n","### [Executive Summary](https://docs.google.com/document/d/e/2PACX-1vTmkF77eMudW857BZqpDQOGW-kE9OUbRgZrtW-e_fuLlhmxwBzi7N-DCNIlNVOA7GPHNy0cy7W_qAEQ/pub)\n","\n","### [Full Report](https://docs.google.com/document/d/e/2PACX-1vS6QPGq9GvQyudr2ZBkCmp-oL9zYIXIQFLn-XPPg_r-LXyMKZJ10SFKYJegl4bQ0Ki4qPXHmIKtX0M-/pub)\n","\n","### [Datasets - Kaggle](https://www.kaggle.com/datasets/phildrysdale/the-deconstruction-network-2020-study)\n","\n","# Contents\n","* Introduction\n","    * What is deconstruction\n","    * The problem\n","    * The goal\n","    * Current research available\n","    * Notes on the survey\n","        * Limitations\n","* Hypotheses\n","* Approach\n","* Data preparation\n","    * Environment setup & importing data\n","    * Data formatting\n","    * Data cleaning\n","    * Data shaping\n","    * Prep final datasets\n","* Exploratory analysis\n","    * Compare control & deconstructing groups for any important differences in demographics\n","    * Exploring the deconstructing group's church attendance\n","    * Exploring the deconstructing group's comfort levels in church\n","    * Exploring the deconstructing group's ability to be open in church\n","    * Exploring the deconstructing group's inability  to find answers to their questions in their faith tradition\n","    * Exploring the deconstructing group's need to let go of core beliefs\n","* Conclusion\n","* Next Steps\n","\n","# Introduction\n","### What is Deconstruction?\n","Deconstruction is a new label claimed by many who leave fundamental forms of faith. It is not something that describes the actions of someone or what they believe, but rather simply that they ceased to believe something. People who deconstruct might remain Christian, become Atheist or anything from the wide gamut of options in between.\n","\n","Because of its nature it is hard to pin down exactly what deconstruction is for people. Even leaders in the deconstruction space often struggle to give a clear working definition for the process. The people deconstructing are often conflated with those who have 'dechurched' (the process of ceasing to attend church), or with 'unaffiliated' / 'nones'(those who don't identify with any faith), or even with forms of Progressive Christiainity however while some of these groups might find overlap with those who deconstruct it often causes more problems than it solves. \n","\n","### The problem\n","There is a large issue with misinformation around deconstruction from two primary sources: \n","\n","1. The fact that those who deconstruct are so diverse can cause a lot of people to label their specific process as deconstruction and incorrectly dismiss other forms. Frequently for example in the media pastors from movements people are leaving are interviewed but not experts in the field. This unintentionally gives a platform to mass misinformation.\n","2. Leaders from the fundamental faiths people are leaving are very prone to lie about the process. Their job is not to share the truth but to try and discredit those who leave as deceived and comfort those who remain as safe and secure.\n","\n","Deconstruction is a very lonely process with many losing their communities, families, friends, faith, God, certainty and purpose etc. But being told that the one community you kind of identify with - the deconstruction community - is for people who aren't like you can cause you to feel even more isolated still. \n","\n","### The goal\n","\n","Our goal in starting this longitudinal study is to try and understand who are those that deconstruct. We hope that this will do 2 main things:\n","\n","1. To help every person in this eclectic movement be seen.\n","2. To put the data of what this process looks like, and who these people are, to counter misinformation.\n","\n","### Current research available\n","There is a lot of data on both those who currently attend church and those who are 'dechurched' (a common term given to those who were regular church goers but have since stopped attending church.) There is also lots of information on those who do not identify with any faith - 'nones' or 'unaffiliated'\n","\n","However all these groups are defined based on their external actions (church attendance) or current beliefs. The problem is that many people who deconstruct still attend church, or don't identify as unaffiliated.\n","\n","This makes understanding this group a bit more complex. There are not core external actions that identify the group, nor do there seem to be a specific set of beliefs that have changed which have been previously highlighted by any research.\n","On the whole the research of this group is largely non-existent. They are often lumped in with Christians, Agnostics, Atheists, Dechurched, Nones, and a whole host of other groupings which don’t accurately represent them as an entire group.\n","\n","### Notes on the survey\n","This initial survey was launched in May of 2020 with the attempt of doing a preliminary mapping of the average person self-identifying as a Deconstructing/ed Christian. It is the first half of a two-part fact finding study to setup a long-term longitudinal study.\n","\n","#### Limitations of the study\n","We have done our very best to capture the wide gamut of the deconstruction space. \n","\n","The author has appeared on over 30 podcasts focusing on deconstruction to promote the survey and has also appealed to over 100 different leaders in the space to share about it on social media. This has hopefully allowed for hopefully a wide range of diversity. \n","\n","However we are aware that the nature of capturing data through these sources might skew the data somewhat with the primary gap being older people who are not as likely to be involved with podcasts and modern forms of social media. \n","\n","With that said we do think that this is OK. The scope of the study is to look at those who self-identify as deconstructing and because those that deconstruct are largely tied together through online spaces and podcasts we are confident that our survey sample will reflect well this group of people. Simply put, while millions of people might go through the internal psychological process of deconstruction all over the world, we are focusing this study on those who then label that process and find community in the label deconstruction.\n","\n","#### Notes on this Kaggle version of the study:\n","The study of this data and original report was created in January 2021 and the author of that report is revisiting that data now in Kaggle for two primary reasons.\n","1. To create more transparency as to how the data was wrangled and explored.\n","2. An additional 500 people have completed the initial survey since the initial report was published, bringing the sample size from just under 700 to just under 1200 - this will give us an opportunity to re-explore the data to see if anything has changed or confirm our inital findings.\n","3. To prepare the data to be used alongside the 2022 study, data for which has now been collected and which will be commencing at the end of August 2022. This study is several times the size of this one in it's scope and so preparing this data in a way that will be compatible with the next will give us a lot more insight into the group as a whole.\n","\n"]},{"cell_type":"markdown","id":"83657f0c","metadata":{"papermill":{"duration":0.031717,"end_time":"2022-09-04T12:40:45.378879","exception":false,"start_time":"2022-09-04T12:40:45.347162","status":"completed"},"tags":[]},"source":["# Hypotheses\n","### Defining Deconstruction\n","\n","Going into this study the big issue was in defining who is a deconstructing Christian. Having worked in this field for many years now I know as well as any that defining one’s beliefs and actions is not easy for the average person going through this process. The very nature of deconstruction is a moving away from a set of beliefs and way of life. But the direction in which they move and the destinations they may reach (if they reach any) can be very varied. \n","\n","In studying deconstruction from a philosophical level (the term itself dates back to the 80s and the philosopher Derrida) and from working with the deconstruction community and prominent voices within it over the years we have put together a hypothesis of how one might be defined as someone who deconstructs.\n","\n","Our primary hypotheses going into the larger meta-study are that this group will most likely fit the following 3 criteria:\n","\n","1. They will have questioned core pillars of their faith tradition and found them to not hold up to scrutiny.\n","2. They will in turn have had to radically change some of their core spiritual beliefs.\n","3. Their ability to make absolute statements of certainty about their faith will be reduced seeing an increase in uncertainty as a whole when considering spiritual matters.\n","\n","With this said, it is important to note that the group we are studying are self-identified as deconstructing Christians. Because of that we may well find some outliers emerge in this study and future studies which will hopefully become more and more obvious as time goes on in our research and create in itself some additional interesting avenues of research."]},{"cell_type":"markdown","id":"0b86ae29","metadata":{"papermill":{"duration":0.031774,"end_time":"2022-09-04T12:40:45.442598","exception":false,"start_time":"2022-09-04T12:40:45.410824","status":"completed"},"tags":[]},"source":["# Approach\n","\n","We approached this initial baseline study with 6 main questions we wanted to answer.\n","\n","1. What does current church attendance look like for those deconstructing?\n","    * If all deconstructing Christians no longer attend church maybe there is a much stronger link to the dechurched than supposed?\n","    * Is it possible that there are different stages of deconstruction which correlate to church attendance or lack thereof?\n","    \n","    \n","2. How comfortable do they feel while attending church services?\n","    * In past research, dechurched groups repeatedly reports being uncomfortable in church services. Again to what degree is there overlap between dechurched and deconstructing Christians?\n","\n","\n","3. How open about their beliefs are they able to be while attending church?\n","    * When looking at the dechurched we see a large link with their inability to be themselves in the group, many citing they felt they had to hide their true beliefs and feelings. We imagine this will also be the case for most deconstructing Christians.\n","\n","\n","4. To what degree has their faith tradition failed to answer their questions, if indeed they had questions?\n","    * Given that the first point in our working definition of deconstructing Christians is that they question their beliefs and find they do not hold up to scrutiny we expect this to be strongly linked to this group.\n","\n","\n","5. To what degree have they had to change beliefs which they passionately held in the past.\n","    * Given that the second point in our working definition of deconstructing Christians is that they have to radically change core beliefs we expect the results from this to be strongly linked to this group.\n","\n","\n","6. Could a measurement of Faith Development like Harris’s Revised Faith Development Scale (RFDS) score be a helpful tool in identifying deconstructing Christians?\n","    * One of our theories behind deconstruction is that it is evidence of people entering later stages of faith development. If this is the case we should see a strong link between this group and higher RFDS scores.\n","\n","\n","*A quick note on the RFDS. The scale was developed by J. Irene Harris and Gary Leak and is built on faith development work dating back through the 70s and especially pulls from Fowler’s groundbreaking work in Faith Development in the 80s in particular. [You can read their original paper on their revising of the scale in 2013 here](https://www.researchgate.net/publication/262798904_The_Revised_Faith_Development_Scale_An_option_for_a_more_reliable_self-report_measurement_of_postconventional_religious_reasoning)"]},{"cell_type":"markdown","id":"eac42ee6","metadata":{"papermill":{"duration":0.032041,"end_time":"2022-09-04T12:40:45.506349","exception":false,"start_time":"2022-09-04T12:40:45.474308","status":"completed"},"tags":[]},"source":["# Data Preparation\n"]},{"cell_type":"markdown","id":"e6430bad","metadata":{"papermill":{"duration":0.031681,"end_time":"2022-09-04T12:40:45.56997","exception":false,"start_time":"2022-09-04T12:40:45.538289","status":"completed"},"tags":[]},"source":["### Environment Setup\n","Here we will setup libraries to be used in this report.\n","\n","We'll suppress startup messages now we've looked through them to ensure there are no major issues or conflicts"]},{"cell_type":"code","execution_count":2,"id":"b01bdd51","metadata":{"execution":{"iopub.execute_input":"2022-09-04T12:40:45.66429Z","iopub.status.busy":"2022-09-04T12:40:45.635278Z","iopub.status.idle":"2022-09-04T12:40:47.721258Z","shell.execute_reply":"2022-09-04T12:40:47.719513Z"},"jupyter":{"source_hidden":true},"papermill":{"duration":2.122019,"end_time":"2022-09-04T12:40:47.72388","exception":false,"start_time":"2022-09-04T12:40:45.601861","status":"completed"},"tags":[]},"outputs":[],"source":["suppressPackageStartupMessages({\n","    library(tidyverse)\n","    library(janitor)\n","    library(stringr)\n","    library(ggridges)\n","    library(scales)\n","    library(corrplot)\n","    library(correlation)\n","    library(Hmisc)\n","    library(infer)\n","})"]},{"cell_type":"markdown","id":"ff782e5c","metadata":{"papermill":{"duration":0.031721,"end_time":"2022-09-04T12:40:47.787429","exception":false,"start_time":"2022-09-04T12:40:47.755708","status":"completed"},"tags":[]},"source":["#### Setup Graphs\n","We'll run some code to customise how our graphs will look throughout this analysis. See comments for details."]},{"cell_type":"code","execution_count":3,"id":"884ea47e","metadata":{"execution":{"iopub.execute_input":"2022-09-04T12:40:47.854304Z","iopub.status.busy":"2022-09-04T12:40:47.852727Z","iopub.status.idle":"2022-09-04T12:40:47.930005Z","shell.execute_reply":"2022-09-04T12:40:47.928286Z"},"jupyter":{"source_hidden":true},"papermill":{"duration":0.113487,"end_time":"2022-09-04T12:40:47.932496","exception":false,"start_time":"2022-09-04T12:40:47.819009","status":"completed"},"tags":[]},"outputs":[],"source":["# This code tweaks the size of the plots drawn in this journal to a more appropriate size.\n","plot_size <- options(repr.plot.width = 14, repr.plot.height = 8)\n","\n","# Create a general theme that will work for most charts we can then modify as needed individually.\n","tdn_theme_base <- theme(\n","      plot.title = element_text(size=20, face=\"bold\",hjust = 0.5,vjust = 2),\n","      plot.subtitle = element_text(size=17, hjust = 0.5),\n","      plot.margin = margin(t = 40, b = 40),\n","      axis.title.x = element_text(size=20, face=\"bold\"),\n","      axis.text.x= element_text(size=20),\n","      axis.title.y = element_text(size=20, face=\"bold\"),\n","      axis.text.y= element_text(size=20),\n","      # Legend settings\n","      legend.position=\"bottom\",\n","      legend.title = element_blank(),\n","      legend.text = element_text(size=20, face=\"bold\"),\n","      legend.spacing.y = unit(0.75, 'cm'),\n","      legend.spacing.x = unit(0.75, 'cm'),\n","      plot.caption= element_text(size=14, vjust = -2),\n","      # Remove Panel grid\n","      panel.grid.major = element_blank(),\n","      panel.grid.minor = element_blank()\n",")\n","tdn_theme <- theme_minimal() + tdn_theme_base\n","\n","# Alternate settings for modifying the legend\n","right_leg <- theme(\n","    legend.position = 'right')\n","bot_leg_wrap <- guides(fill = guide_legend(nrow = 2))\n","space_leg <- guides(fill = guide_legend(byrow = TRUE))\n","\n","# Panel Grid options to be modified based on type of graph\n","grid_both <- theme(panel.grid.major = element_line(colour = \"#808080\"))\n","grid_x <- theme(panel.grid.major.x = element_line(colour = \"#808080\"))\n","grid_x_light <- theme(panel.grid.major.x = element_line(colour = \"#e7e6e6\"))\n","grid_y <- theme(panel.grid.major.y = element_line(colour = \"#808080\"))\n","grid_y_light <- theme(panel.grid.major.y = element_line(colour = \"#e7e6e6\"))\n","\n","# Options for changing axis text \n","angle_y <- theme(axis.text.y=element_text(size=20, angle=30))\n","angle_x <- theme(axis.text.x=element_text(size=20, angle=30))\n","no_y <- theme(axis.text.y=element_blank(),axis.ticks.y=element_blank())\n","\n","# Options to set scale to percentage for graphs that need this.\n","percent_y <- scale_y_continuous(labels = scales::percent_format(scale = 1))\n","percent_x <- scale_x_continuous(labels = scales::percent_format())\n","\n","## Color Groupings to ensure uniform coloring throughout.\n","# 2 color options\n","colors_2 <- scale_fill_manual(values=c('#f9b301','#4472c4'))\n","colors_2_sex <- scale_fill_manual(values=c('#f9b301','#4472c4'), labels = c('Female','Male'))\n","colors_2_group <- scale_fill_manual(values=c('#f9b301','#4472c4'), labels = c('Control','Deconstructing'))\n","colors_2_point <- scale_color_manual(values=c('#f9b301','#4472c4'))\n","colors_2_comf <- scale_fill_manual(values=c('#f9b301','#4472c4'), labels = label_wrap(10))\n","\n","# 3 color options\n","colors_3 <- scale_fill_manual(values=c('#f9b301','#e7e6e6','#4472c4'))\n","colors_3_att <- scale_fill_manual(values=c('#f9b301','#e7e6e6','#4472c4'), labels = c('Never','Infrequently', 'At Least Weekly'))\n","\n","# 4 color options\n","colors_4 <- scale_fill_manual(values=c('#f9b301','#ffd966','#8faadc','#4472c4'))\n","colors_4_ages <- scale_fill_manual(values=c('#f9b301','#ffd966','#8faadc','#4472c4'), labels = c('18-29 yrs','30-49 yrs','50-64 yrs','65+ yrs'))\n","\n","# 5 color options\n","colors_5 <- scale_fill_manual(values=c('#f9b301','#ffd966','#e7e6e6','#8faadc','#4472c4'),labels = label_wrap(15))\n","colors_5_ages <- scale_fill_manual(values=c('#f9b301','#ffd966','#e7e6e6','#8faadc','#4472c4'), labels = c('under 18 yrs','18-29 yrs','30-49 yrs','50-64 yrs','65+ yrs'))\n","\n","# 6 color options\n","colors_6 <- scale_fill_manual(values=c('#f9b301','#ffd966','#e7e6e6','#e7e6f5','#8faadc','#4472c4'))"]},{"cell_type":"markdown","id":"821a10a7","metadata":{"papermill":{"duration":0.032058,"end_time":"2022-09-04T12:40:48.029958","exception":false,"start_time":"2022-09-04T12:40:47.9979","status":"completed"},"tags":[]},"source":["## Importing Data\n","\n","There are two primary datasets we'll be using related to the survey:\n","\n","#### Survey 1 - Deconstructed\n","\n","The 2020 survey was given to 1181 people who had self-described as having \n","deconstructed their faith. \n","This is can be found attached as \"survey2020_raw.csv\". \n","\n","#### Survey 1 - Control\n","\n","The 2020 survey was also given to 38 content, conventional Christians who did not identify with deconstruction \n","as a control sample.\n","This is can be found attached as \"control2020_raw.csv\".\n","\n","*Note: Both datasets were anonymized before uploading to the internet to protect user identity. User_ID was hased using a custom hash code so that the data could be linked to future surveys by the same users. All other identifying information was removed."]},{"cell_type":"code","execution_count":4,"id":"01370657","metadata":{"execution":{"iopub.execute_input":"2022-09-04T12:40:48.097898Z","iopub.status.busy":"2022-09-04T12:40:48.096303Z","iopub.status.idle":"2022-09-04T12:40:48.643245Z","shell.execute_reply":"2022-09-04T12:40:48.640607Z"},"papermill":{"duration":0.584986,"end_time":"2022-09-04T12:40:48.646542","exception":false,"start_time":"2022-09-04T12:40:48.061556","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["\u001b[1m\u001b[22mNew names:\n","\u001b[36m•\u001b[39m `` -> `...4`\n","\u001b[1mRows: \u001b[22m\u001b[34m38\u001b[39m \u001b[1mColumns: \u001b[22m\u001b[34m57\u001b[39m\n","\u001b[36m──\u001b[39m \u001b[1mColumn specification\u001b[22m \u001b[36m────────────────────────────────────────────────────────\u001b[39m\n","\u001b[1mDelimiter:\u001b[22m \",\"\n","\u001b[31mchr\u001b[39m (30): user_id, Email, Sex, Country, State, How often do you attend churc...\n","\u001b[32mdbl\u001b[39m (24): Age, How often do you attend church?, When you last attended a ch