 well as candidates were collected from across the community via various podcasts and instagram influencers focusing on the issue.\n","\n","**Finding 2: There is not enough participation in our study from people who identify as non-binary.**\n","\n","While this is a very important subset of the population, unfortunately any use of this data to make statements about this group of people would only likely create misinformation.\n","\n","For this reason we will have to, within the scope of this study, focus solely on those who identify as either male or female when discussing matters relating to sex. However we will obviously still include their relevant information in other metrics where sex is not explored.\n"]},{"cell_type":"markdown","id":"dc206ab1","metadata":{"papermill":{"duration":0.04059,"end_time":"2022-09-04T12:40:55.568595","exception":false,"start_time":"2022-09-04T12:40:55.528005","status":"completed"},"tags":[]},"source":["### Age\n","#### Calculations\n","First things first we will have a look at the age distribution of our two groups."]},{"cell_type":"code","execution_count":20,"id":"6614f8a4","metadata":{"execution":{"iopub.execute_input":"2022-09-04T12:40:55.652551Z","iopub.status.busy":"2022-09-04T12:40:55.650897Z","iopub.status.idle":"2022-09-04T12:40:55.683213Z","shell.execute_reply":"2022-09-04T12:40:55.68137Z"},"papermill":{"duration":0.076668,"end_time":"2022-09-04T12:40:55.68551","exception":false,"start_time":"2022-09-04T12:40:55.608842","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A data.frame: 6 × 3</caption>\n","<thead>\n","\t<tr><th scope=col>h_age_stats</th><th scope=col>c_age_stats</th><th scope=col>d_age_stats</th></tr>\n","\t<tr><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>Min               </td><td>18.00000</td><td> 13.00000</td></tr>\n","\t<tr><td>Mean              </td><td>44.84211