h women rights and equality being common themes in many people’s deconstruction women have more reason to feel unable to continue in institutions that oppress them than men who are less affected by such systems of oppression. It must also be said that generally speaking women who question the system are much less likely to be heard out than men, again making the church a much more hostile place for a deconstructing female than a deconstructing male. More studies on this are being planned.\n"]},{"cell_type":"markdown","id":"15ab060c","metadata":{"papermill":{"duration":0.062327,"end_time":"2022-09-04T12:41:05.06128","exception":false,"start_time":"2022-09-04T12:41:04.998953","status":"completed"},"tags":[]},"source":["### Church Attendance by Age"]},{"cell_type":"code","execution_count":40,"id":"3bc1f2b9","metadata":{"execution":{"iopub.execute_input":"2022-09-04T12:41:05.18981Z","iopub.status.busy":"2022-09-04T12:41:05.188326Z","iopub.status.idle":"2022-09-04T12:41:05.246208Z","shell.execute_reply":"2022-09-04T12:41:05.244615Z"},"papermill":{"duration":0.124007,"end_time":"2022-09-04T12:41:05.248499","exception":false,"start_time":"2022-09-04T12:41:05.124492","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 15 × 3</caption>\n","<thead>\n","\t<tr><th scope=col>age_group</th><th scope=col>attend_lvl</th><th scope=col>percent</th></tr>\n","\t<tr><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>&lt;=18 yrs </td><td><span style=white-space:pre-wrap>Never          </span></td><td>23.07692</td></tr>\n","\t<tr><td>&lt;=18 yrs </td><td><span style=white-space:pre-wrap>Infrequently   </span></td><td>30.76923</td></tr>\n","\t<tr><td>&lt;=18 yrs </td><td>At Least Weekly</td><td>46.15385</td></tr>\n","\t<tr><td>18-29 yrs</td><td>Never          </td><td>35.30928</td></tr>\n","\t<tr><td>18-29 yrs</td><td>Infrequently   </td><td>