ACCEU7AAAAAAAAIAQQsEOAAAAAAAACCEU7AAA\nAAAAAIAQQsEOAAAAAAAACCEU7AAAAAAAAIAQQsEOAAAAAAAACCEU7AAAAAAAAIAQQsEOAAAA\nAAAACCEU7AAAAAAAAIAQQsEOAAAAAAAACCEU7AAAAAAAAIAQQsEOAAAAAAAACCEU7AAAAAAA\nAIAQQsEOAAAAAAAACCEU7AAAAAAAAIAQQsEOAAAAAAAACCEU7AAAAAAAAIAQQsEOAAAAAAAA\nCCEU7AAAAAAAAIAQQsEOAAAAAAAACCEU7AAAAAAAAIAQQsEOAAAAAAAACCEU7AAAAAAAAIAQ\nQsEOAAAAAAAACCEU7AAAAAAAAIAQQsEOAAAAAAAACCEU7AAAAAAAAIAQQsEOAAAAAAAACCEU\n7AAAAAAAAIAQQsEOAAAAAAAACCEU7AAAAAAAAIAQQsEOAAAAAAAACCEU7AAAAAAAAIAQQsEO\nAAAAAAAACCEU7AAAAAAAAIAQ8n/gOTwFnv1/AAAAAABJRU5ErkJggg=="},"metadata":{"image/png":{"height":480,"width":840}},"output_type":"display_data"}],"source":["ggplot(s_att_age_pct, aes(x=percent, y=age_group, fill=factor(attend_lvl, s_attend_order))) +\n","  geom_col(width = 0.5, position = \"fill\", color='#000000')+\n","  tdn_theme+\n","  labs(title = \"Deconstructing Attendance by Age\",\n","        caption = \"Data source: The Deconstruction Network 2020\",\n","        x = \"\", y = \"\")+\n","percent_x+\n","grid_x+\n","space_leg+\n","colors_3\n"]},{"cell_type":"markdown","id":"1b9ff5f0","metadata":{"papermill":{"duration":0.065162,"end_time":"2022-09-04T12:41:05.859105","exception":false,"start_time":"2022-09-04T12:41:05.793943","status":"completed"},"tags":[]},"source":["### Observations of Age's influence on Church Attendance of those who deconstruct\n","\n"]},{"cell_type":"markdown","id":"304388db","metadata":{"papermill":{"duration":0.066445,"end_time":"2022-09-04T12:41:05.989917","exception":false,"start_time":"2022-09-04T12:41:05.923472","status":"completed"},"tags":[]},"source":["**Finding 8: Ages 18 - 49 yrs old were less likely to attend church weekly when compared to other ages. The highest scoring age brackets being <18 & 65+ in both groups 46% attended at least once a week.**\n","\n","Age is often cited as a factor in deconstruction, a common theme being that those in the 18-29 years bracket are most likely to deconstruct.\n","\n","However the 18-29yr old group were less likely to never attend church than those who were in the next two age brackets spanning 30-64 yrs of age. In fact, they were also more likely to attend church at least once a week than their 30-49yr old counterparts.\n","\n","There is a large uptick in those under 18 and 65 and over who both scored 46% for attending church at least once a week. There could be a myriad of reasons for each age bracket's frequent church attendance but a couple of reasons that might warrant further exploration are:\n","\n","1. In the case of those under 18 it is probably a reasonable assumption that this might be related to requirements of parents to attend church while still being 'a child under our roof.' (A common phrase heard by the author when working with teens who are deconstructing).\n","\n","2. In the case of those over 65 it is likely they have some measure of a sunk-cost fallacy with such huge social barriers to leaving that attendance is less of a pain than leaving.\n","\n","Age gaps in church attendance have sometimes been linked to higher education playing a part. This will be studied further in our next report but is a common belief and higher education has been shown to be present in those who are dechurched – (Packard, Hope 2015)\n","\n","One thing is for sure, with 24% of 18-29yr old deconstructing Christians attending church at least once a week we can safely say that while many deconstructing Christians have dechurched a good quarter or so in this age bracket are still attending.\n"]},{"cell_type":"markdown","id":"81d6a13f","metadata":{"papermill":{"duration":0.063401,"end_time":"2022-09-04T12:41:06.116518","exception":false,"start_time":"2022-09-04T12:41:06.053117","status":"completed"},"tags":[]},"source":["### Church Attendance by Country"]},{"cell_type":"code","execution_count":42,"id":"16991f7f","metadata":{"execution":{"iopub.execute_input":"2022-09-04T12:41:06.246506Z","iopub.status.busy":"2022-09-04T12:41:06.245011Z","iopub.status.idle":"2022-09-04T12:41:06.303866Z","s