hMAOAAAAAAAAMBACOwAAAAAAAMBACOwAAAAAAAAAAyGwAwAAAAAAAAyEwA4A\nAAAAAAAwEAI7AAAAAAAAwEAI7AAAAAAAAAADIbADAAAAAAAADITADgAAAAAAADAQAjsAAAAA\nAADAQAjsAAAAAAAAAAMhsAMAAAAAAAAMhMAOAAAAAAAAMBACOwAAAAAAAMBACOwAAAAAAAAA\nAyGwAwAAAAAAAAyEwA4AAAAAAAAwEAI7AAAAAAAAwEAI7AAAAAAAAAADIbADAAAAAAAADITA\nDgAAAAAAADAQAjsAAAAAAADAQAjsAAAAAAAAAAMhsAMAAAAAAAAMhMAOAAAAAAAAMBACOwAA\nAAAAAMBACOwAAAAAAAAAAyGwAwAAAAAAAAyEwA4AAAAAAAAwEAI7AAAAAAAAwEAI7AAAAAAA\nAAADIbADAAAAAAAADITADgAAAAAAADAQAjsAAAAAAADAQAjsAAAAAAAAAAMhsAMAAAAAAAAM\nhMAOAAAAAAAAMBACOwAAAAAAAMBA/gdpxivi3AK0hQAAAABJRU5ErkJggg=="},"metadata":{"image/png":{"height":480,"width":840}},"output_type":"display_data"}],"source":["ggplot(s_att_rfds_pct, aes(x=percent, y=rfds_group, fill=factor(attend_lvl, s_attend_order))) +\n","  geom_col(width = 0.5, position = \"fill\", color='#000000') +\n","tdn_theme+\n","labs(title = \"Deconstructing Attendance by RFDS Score\",\n","caption = \"Data source: The Deconstruction Network 2020\",\n","x = \"\", y = \"\")+\n","percent_x+\n","grid_x+\n","space_leg+\n","colors_3"]},{"cell_type":"markdown","id":"7c81ce50","metadata":{"papermill":{"duration":0.06838,"end_time":"2022-09-04T12:41:08.003874","exception":false,"start_time":"2022-09-04T12:41:07.935494","status":"completed"},"tags":[]},"source":["### Observations on church attendance by RFDS score\n","**Finding 9: There was a strong negative correlation between RFDS and church attendance, with the highest scoring group being twice as likely to never attend church compared to the lowest scoring group.**\n","\n","When we look at attendance when compared to RFDS scores we can see a clear direction in the results. With the highest scoring group being over twice as likely to never attend church compared to the lowest scoring group. The lowest scoring group are around 2.7x as likely to attend at least once a week when compared to the highest group.\n","\n","From this we can see a very clear link between faith development and church attendance. If, and as it stands it is still an if, RFDS can be linked to Deconstruction this could suggest that continued church attendance among this group might be due to deconstruction being at an early stage of development and continued deconstruction may be more likely to result in leaving the church. More research will have to be conducted to see if RFDS can be linked to depth of deconstruction.\n"]},{"cell_type":"markdown","id":"524771f7","metadata":{"papermill":{"duration":0.0681,"end_time":"2022-09-04T12:41:08.139816","exception":false,"start_time":"2022-09-04T12:41:08.071716","status":"completed"},"tags":[]},"source":["## Exploring the deconstructing group's comfort levels in church\n","One of our theories going into this initial study was that there would be a strong link between deconstruction and how comfortable people felt at church. A common thing cited by those who deconstruct is that they no longer feel comfortable in their own communities.\n","\n","In the following charts we will also create a simplified dataframe - This scale will be based on how an \"insider\" might feel about the responses... ie. what would a leader in these religious organisations see how the person felt in their church as positive or negative outcome. In this we assume that someone feeling neutral about their comfort levels would not be positive for a healthy organisation who are trying to make people feel comfortable."]},{"cell_type":"code","execution_count":46,"id":"5b4eec4f","metadata":{"execution":{"iopub.execute_input":"2022-09-04T12:41:08.280701Z","iopub.status.busy":"2022-09-04T12:41:08.278923Z","iopub.status.idle":"2022-09-04T12:41:08.358755Z","shell.execute_reply":"2022-09-04T12:41:08.356969Z"},"papermill":{"duration":0.153229,"end_time":"2022-09-04T12:41:08.361119","exception":false,"start_time":"2022-09-04T12:41:08.20789","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 10 × 3</caption>\n","<thead>\n","\t<tr><th scope=col>su