tructing vs Control's Comfort Levels in Church\",\n","        caption = \"Data source: The Deconstruction Network 2020\",\n","        x = \"\", y = \"\")+                   \n","percent_y+\n","grid_y+\n","space_leg+\n","colors_2_group\n","                   \n","ggplot(s_comf_pct, aes(percent, survey, fill=factor(comf_lvl,s_comfort_order)))+\n","geom_col(width = 0.5,position='fill', color='#000000')+\n","tdn_theme+\n","labs(title = \"Deconstructing vs Control's Comfort Levels in Church Simplified\",\n","caption = \"Data source: The Deconstruction Network 2020\",\n","x = \"\", y = \"\")+  \n","percent_x+\n","grid_x+\n","angle_y+\n","space_leg+\n","colors_2                  "]},{"cell_type":"markdown","id":"8423842f","metadata":{"papermill":{"duration":0.231699,"end_time":"2022-09-04T12:41:09.449478","exception":false,"start_time":"2022-09-04T12:41:09.217779","status":"completed"},"tags":[]},"source":["### Observations of Deconstructing vs Control group's comfort levels in church\n","**Finding 10: 87% of content Christians claimed to be comfortable in church vs only 22% of Deconstructing Christians.**\n","\n","As you can see the control group of “content Christians” reported as 58% very comfortable and 29% somewhat comfortable. This was a stark difference to deconstructing/ed Christians of whom just under 7% could claim to feel very comfortable at their last church attendance with a slightly higher 15% feeling somewhat comfortable.\n","\n","If we were to break this down into a pragmatic divide of positive (comfortable) or negative (uncomfortable or neutral) the difference is stark. With 87% giving a positive response in the content Christian category and only 22% of deconstructing/ed Christians giving a positive response.\n","\n","Again however this is quite different than many might have supposed. Yet again, we find just over a fifth of our group seeming to be defying common assumptions of this group by claiming to be comfortable in church.\n","\n","We look forward t