us":"completed"},"tags":[]},"source":["### Observations on comfort levels in church and age\n","**Finding 12: The two oldest groups had significantly higher comfort scores than the younger generations. While 0% of the under 18yr group could say they felt very comfortable the last time they attended church**\n","\n","Again age seems to be pointing quite clearly to a trend in church comfort levels. We found that on the whole church comfort levels increased as the participants aged. Interestingly the top age bracket saw a slight dip in overall comfort levels, however when looking at the metric \"very comfortable\" we can see that the oldest group was almost 7 times as comfortable as the second youngest group. The youngest group did not return a single person who felt very comfortable the last time they were in church.\n"]},{"cell_type":"markdown","id":"2d8b954d","metadata":{"papermill":{"duration":0.074542,"end_time":"2022-09-04T12:41:12.34191","exception":false,"start_time":"2022-09-04T12:41:12.267368","status":"completed"},"tags":[]},"source":["### Comfort levels in church by Country"]},{"cell_type":"code","execution_count":52,"id":"ae2e25bf","metadata":{"execution":{"iopub.execute_input":"2022-09-04T12:41:12.494313Z","iopub.status.busy":"2022-09-04T12:41:12.492618Z","iopub.status.idle":"2022-09-04T12:41:12.610643Z","shell.execute_reply":"2022-09-04T12:41:12.608867Z"},"papermill":{"duration":0.197178,"end_time":"2022-09-04T12:41:12.613108","exception":false,"start_time":"2022-09-04T12:41:12.41593","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 20 × 3</caption>\n","<thead>\n","\t<tr><th scope=col>country</th><th scope=col>comf_lvl</th><th scope=col>percent</th></tr>\n","\t<tr><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>Australia     </td><td>Very Uncomfortable    </td><td>33.333333</td></tr>\n","\t<tr><td>Aus