 aes(percent, sex, fill=factor(open_lvl,open_order)))+\n","geom_col(width = 0.5,position='fill', color='#000000')+\n","tdn_theme+\n","labs(title = \"Deconstructing Christian's'Ability to be Open About Beleifs by Sex\",\n","caption = \"Data source: The Deconstruction Network 2020\",\n","x = \"\", y = \"\")+ \n","percent_x+\n","grid_x+\n","space_leg+\n","colors_4\n","\n","ggplot(s_open_sex_pct, aes(x=sex, y= percent, fill = open_lvl)) +\n","  geom_col(width = 0.5, position = \"dodge\", color='#000000') + \n","tdn_theme+\n","labs(title = \"Deconstructing Christian's'Ability to be Open About Beleifs by Sex Simplified\",\n","caption = \"Data source: The Deconstruction Network 2020\",\n","x = \"\", y = \"\")+                    \n","percent_y+\n","grid_y+\n","space_leg+\n","colors_2_sex"]},{"cell_type":"markdown","id":"a4875629","metadata":{"papermill":{"duration":0.084139,"end_time":"2022-09-04T12:41:18.52126","exception":false,"start_time":"2022-09-04T12:41:18.437121","status":"completed"},"tags":[]},"source":["### Observations on ability to be open in church by sex\n","**Finding 15: Men were 3 times as likely to feel very comfortable as women were the last time they attended church.**\n","\n","When looking at the male/female split there doesn’t seem much in it with 69% of males and 74% of females reporting they felt they had to hide their beliefs in one way or another. However when we look at the results in more detail we find that while those who could be completely open about their faith were a tiny minority, men were 3 times more likely to feel they could be completely open about their faith.\n","\n","This could be pointing to why it seems more women deconstruct than men, and possibly why more men who deconstruct remain frequent attendees in churches. It has certainly long been highlighted that there is much more room made for men who question their faith and believe differently than there is for women."]},{"cell_type":"markdown","id":"4a4ceb0a","metadata":{"papermi