econstructing Christian's'Ability to be Open About Beleifs by Age Simplified\",\n","caption = \"Data source: The Deconstruction Network 2020\",\n","x = \"\", y = \"\")+ \n","percent_x+\n","grid_x+\n","space_leg+\n","colors_2"]},{"cell_type":"markdown","id":"0826e311","metadata":{"papermill":{"duration":0.08725,"end_time":"2022-09-04T12:41:20.039455","exception":false,"start_time":"2022-09-04T12:41:19.952205","status":"completed"},"tags":[]},"source":["### Observations on ability to be open in church by age\n","**Finding 16: With each increase in age group we saw in a marked increase in comfort levels, 8% (<18yrs), 22% (18-29yrs), 24% (30-49yrs), 36% (50-64yrs), 56% (65yrs+).**\n","\n","Age again seems to be a significant factor. There is a marked increase of openness in each consecutive jump in age group, with those 65+ being more than 7 times able to be open about their beliefs with those around them than the youngest. In fact nobody in the under 18's group could answer than they felt they could be completely open and only 8% felt they could be somewhat open.\n","\n","While overall as the population was able to be more open in the older groups looking at the details highlights an interesting caveat. The youngest group was actually the least likely to feel they had to completely hide their beliefs (again 8%) which jumped significantly in the next two age brackets both up to 26%."]},{"cell_type":"markdown","id":"5dcc84c0","metadata":{"papermill":{"duration":0.086489,"end_time":"2022-09-04T12:41:20.213057","exception":false,"start_time":"2022-09-04T12:41:20.126568","status":"completed"},"tags":[]},"source":["### Ability to be open in church by Country"]},{"cell_type":"code","execution_count":62,"id":"3eedbfa7","metadata":{"execution":{"iopub.execute_input":"2022-09-04T12:41:20.38905Z","iopub.status.busy":"2022-09-04T12:41:20.387322Z","iopub.status.idle":"2022-09-04T12:41:20.504456Z","shell.execute_reply":"2022-09-04T12:41:20.502504Z"},"papermill":{"duration":0.208496,