 of the 4 groups is for any score under 48."]},{"cell_type":"markdown","id":"8a7ae068","metadata":{"papermill":{"duration":0.091047,"end_time":"2022-09-04T12:41:22.621943","exception":false,"start_time":"2022-09-04T12:41:22.530896","status":"completed"},"tags":[]},"source":["## Exploring the deconstructing group's failure to find answers to it's questions of their faith tradition"]},{"cell_type":"code","execution_count":66,"id":"c87117e1","metadata":{"execution":{"iopub.execute_input":"2022-09-04T12:41:22.808359Z","iopub.status.busy":"2022-09-04T12:41:22.806638Z","iopub.status.idle":"2022-09-04T12:41:22.907991Z","shell.execute_reply":"2022-09-04T12:41:22.905905Z"},"papermill":{"duration":0.197236,"end_time":"2022-09-04T12:41:22.910698","exception":false,"start_time":"2022-09-04T12:41:22.713462","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 8 × 3</caption>\n","<thead>\n","\t<tr><th scope=col>survey</th><th scope=col>failed_lvl</th><th scope=col>percent</th></tr>\n","\t<tr><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>Control       </td><td>Very unlike me    </td><td>31.578947</td></tr>\n","\t<tr><td>Control       </td><td>Slightly unlike me</td><td>39.473684</td></tr>\n","\t<tr><td>Control       </td><td>Slightly like me  </td><td>18.421053</td></tr>\n","\t<tr><td>Control       </td><td>Very like me      </td><td>10.526316</td></tr>\n","\t<tr><td>Deconstructing</td><td>Very unlike me    </td><td> 2.311644</td></tr>\n","\t<tr><td>Deconstructing</td><td>Slightly unlike me</td><td> 2.825342</td></tr>\n","\t<tr><td>Deconstructing</td><td>Slightly like me  </td><td>14.897260</td></tr>\n","\t<tr><td>Deconstructing</td><td>Very like me      </td><td>79.965753</td></tr>\n","</tbody>\n","</table>\n"],"text/latex":["A tibble: 8 × 3\n","\\begin{tabular}{lll}\n"," survey & failed\\_lvl & percent\\\\\n"," <chr> & <chr> & 