ntrol groups failure to find answers\n","**Finding 18: 95% of deconstructing Christians agreed with the statement, “I’ve questioned my faith tradition and it’s failed to provide satisfactory answers”, only 29% of the control group did.**\n","\n","For our first criteria of deconstructing Christians we hypothesized that the group would have questioned core pillars of their faith tradition and found them to not hold up to scrutiny.\n","\n","We therefore asked the participants to respond to the statement “I’ve questioned my faith tradition and it’s failed to provide satisfactory answers.”\n","\n","As we can see the control group responded with a spread across the board with about 71% disagreeing and 29% agreeing to some degree with the statement.\n","The deconstructing/ed group however were split much more drastically with 5% disagreeing and 95% agreeing. A whopping 80% strongly agreed with the statement.\n","\n","Deconstructing Christians were more than 3 times as likely to say that their faith tradition could not answer their questions than those in the content Christians sample with only 2% of the group stating the statement was very unlike them.\n","\n","This highlights that there is an extremely strong link between deconstruction and questioning one's core beliefs and failing to find satisfactory answers within the same tradition."]},{"cell_type":"markdown","id":"51e897b5","metadata":{"papermill":{"duration":0.092053,"end_time":"2022-09-04T12:41:23.827007","exception":false,"start_time":"2022-09-04T12:41:23.734954","status":"completed"},"tags":[]},"source":["### Failure to find answers by sex"]},{"cell_type":"code","execution_count":68,"id":"9192b9b3","metadata":{"execution":{"iopub.execute_input":"2022-09-04T12:41:24.015888Z","iopub.status.busy":"2022-09-04T12:41:24.014293Z","iopub.status.idle":"2022-09-04T12:41:24.11134Z","shell.execute_reply":"2022-09-04T12:41:24.10959Z"},"papermill":{"duration":0.195339,"end_time":"2022-09-04T12:41:24.113884","exception":false,