rentiate between slight and strong agreement/disagreement the progression becomes even more clear.\n","\n","While we see a clear progression of 85%, 94%, 97%, 100% in agreement as we move up the RFDS scores groupings. The change in strong agreement is more stark progressing as 51%, 74%, 88%, 96%. Showing that as ones faith is developed you are much more likely to strongly identify with this process of questioning and failing to find answers within your faith tradition."]},{"cell_type":"markdown","id":"46338398","metadata":{"papermill":{"duration":0.100958,"end_time":"2022-09-04T12:41:28.984469","exception":false,"start_time":"2022-09-04T12:41:28.883511","status":"completed"},"tags":[]},"source":["## Exploring the deconstructing group's need to change their core beliefs\n"]},{"cell_type":"code","execution_count":76,"id":"2157b9a2","metadata":{"execution":{"iopub.execute_input":"2022-09-04T12:41:29.194454Z","iopub.status.busy":"2022-09-04T12:41:29.192525Z","iopub.status.idle":"2022-09-04T12:41:29.281891Z","shell.execute_reply":"2022-09-04T12:41:29.280059Z"},"papermill":{"duration":0.199903,"end_time":"2022-09-04T12:41:29.284988","exception":false,"start_time":"2022-09-04T12:41:29.085085","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 8 × 3</caption>\n","<thead>\n","\t<tr><th scope=col>survey</th><th scope=col>letgo_lvl</th><th scope=col>percent</th></tr>\n","\t<tr><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>Control       </td><td>Very unlike me    </td><td>31.578947</td></tr>\n","\t<tr><td>Control       </td><td>Slightly unlike me</td><td>13.157895</td></tr>\n","\t<tr><td>Control       </td><td>Slightly like me  </td><td>23.684211</td></tr>\n","\t<tr><td>Control       </td><td>Very like me      </td><td>31.578947</td></tr>\n","\t<tr><td>Deconstructing</td><td>Very unlike me    </td><td> 1.969178</td></tr>\n",