ill = survey)) +\n","  geom_col(width = 0.75, position = \"dodge\", color='#000000') + \n","  scale_x_discrete(limits = letgo_order)+\n","tdn_theme+\n","labs(title = \"Deconstructing vs Control's Need to Change Core Beleifs\",\n","caption = \"Data source: The Deconstruction Network 2020\",\n","x = \"\", y = \"\")+\n","percent_y+\n","grid_y+\n","space_leg+\n","colors_2\n"]},{"cell_type":"markdown","id":"ef9f7e1a","metadata":{"papermill":{"duration":0.103245,"end_time":"2022-09-04T12:41:30.068524","exception":false,"start_time":"2022-09-04T12:41:29.965279","status":"completed"},"tags":[]},"source":["### Observations on the deconstructing vs control groups need to change their core beliefs\n","**Finding 21: 95% of deconstructing Christians agreed with the statement, “I’ve had to let go of things I passionately believed at earlier stages of my faith.” Whereas only 55% of the control group could agree with the statement.**\n","\n","Part of our hypothesis was that, not content with just questioning ones beliefs, once those who deconstruct have done so and failed to find answers they will have to let go of beliefs they were once very passionately attached to.\n","\n","In this question we explore this and find that once again the control group of “content Christians” respond right across the spectrum of answers. When looking at the responses in a like me / unlike me binary, 45% of the control group disagreed and 55% agreed, meanwhile in the deconstructing/ed group 4% disagreed and 96% agreed.\n","\n","This seems to support the hypothesis that those who deconstruct will have to let go of key beliefs."]},{"cell_type":"markdown","id":"65922e47","metadata":{"papermill":{"duration":0.104453,"end_time":"2022-09-04T12:41:30.278336","exception":false,"start_time":"2022-09-04T12:41:30.173883","status":"completed"},"tags":[]},"source":["### Need to change their core beliefs and Sex"]},{"cell_type":"code","execution_count":78,"id":"ff25e83b","metadata":{"execution":{"iopub.execute_inp